import { Input } from "antd";
import React from "react";
import styled from "styled-components";

const Wrapper = styled.div`
  .inputType {
    width: 315px;
    height: 60px;
    border-radius: 20px;
    font-size: 18px;
  }
`;

export default function InputText(subtext) {
  return (
    <Wrapper>
      <Input className="inputType" placeholder="Nhập địa chỉ ví muốn gửi" />
    </Wrapper>
  );
}
